    false,nt"url": null,nt"notes": "This narrative report for Necedah NWR outlines
    Refuge accomplishments from November, 1938 through January, 1939. The report begins
    by summarizing the weather conditions during this period. Wildlife- including migratory
    birds, upland game birds, big game animals, and furbearers- is also covered. The
    Refuge development and maintenance section discusses physical developments. Resource
    management is outlined; topics include grazing and timber removal. The public relations
    section of the report describes Refuge visitors and hunting. A list of wildlife
    is attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
